
/** STATIC CONSTANTS **/

const AI_SLOTS_NAMES = ["rat", "snake", "pig", "wolf", "saladin", "caliph", "sultan", "richard", "frederick", "phillip", "wazir", "emir", "nizar", "sheriff", "marshal", "abbot"];

const AI_PORTRAIT_MISSING = "data:image/png;base64,";

/* Base64 encoded versions of the original game portraits. All rights belong to Firefly Studios. */
const AI_PORTRAIT_DATA = {
  "rat": "data:image/png;base64,",
  "snake": "data:image/png;base64,",
  "pig": "data:image/png;base64,",
  "wolf": "data:image/png;base64,",
  "saladin": "data:image/png;base64,",
  "caliph": "data:image/png;base64,",
  "sultan": "data:image/png;base64,",
  "richard": "data:image/png;base64,",
  "frederick": "data:image/png;base64,",
  "phillip": "data:image/png;base64,",
  "wazir": "data:image/png;base64,",
  "emir": "data:image/png;base64,",
  "nizar": "data:image/png;base64,",
  "sheriff": "data:image/png;base64,",
  "marshal": "data:image/png;base64,",
  "abbot": "data:image/png;base64,",
};

const AI_CONTROL_SETTINGS = ["binks", "speech", "lines", "portrait", "aic", "aiv", "lord", "startTroops"];

const AI_SELECT_EVENT = "ai_select_event";
const AI_CHANGE_UPDATE_EVENT = "ai_change_update_event";

const DEFAULT_VALUE_MARKER = "";

const PATH_ROOT_VERSION_PART_REGEX = /(?<=ucp\/plugins\/.+)-[\d\.]+(?=\/.*)/;

/** DYNAMIC GLOBALS **/

const GENERAL_LOCALIZATION = {
  "change.language.default": null,
  "change.language.default.ai": null,
  "change.button.locked": null
};

const AI_SLOTS = new Map();

const FOUND_AI_META = new Map();

let DEFAULT_LANGUAGE = DEFAULT_VALUE_MARKER;


/** HELPER **/

function isPrimitiveBool(bool) {
  return typeof bool === "boolean";
}

function receiveBooleanOrFallback(bool, fallback = undefined) {
  return isPrimitiveBool(bool) ? bool : fallback;
}

function receiveStringOrFallback(str, fallback = undefined) {
  return typeof str === "string" ? str : fallback;
}

function addEnterAndClickListener(element, func) {
  element.addEventListener("click", func);
  element.addEventListener("keydown", (event) => {
    if (event.key === "Enter") {
      event.preventDefault();
      element.click();
    }
  });
}

function createTextCell(text) {
  const cell = document.createElement("td")
  cell.textContent = text;
  return cell;
}

function createBooleanText(bool) {
  return isPrimitiveBool(bool) ? (bool ? "\u2714" : "\u2716") : "-";
}

function createBooleanCell(bool) {
  return createTextCell(createBooleanText(bool));
}

function createSimpleOptionElement(value, label) {
  const option = document.createElement("option");
  option.value = value;
  option.textContent = label ?? value;
  return option;
}

function createVersionFreeRootPath(path) {
  return path.replace(PATH_ROOT_VERSION_PART_REGEX, "");
}

/** CLASSES **/

class AiControl {
  binks;
  speech;
  lines;
  portrait;
  aic;
  aiv;
  lord;
  startTroops;

  static fromControlObject(controlObj, fallback = undefined) {
    const aiControl = new AiControl();
    AI_CONTROL_SETTINGS.forEach((setting) => aiControl[setting] = receiveBooleanOrFallback(controlObj[setting], fallback));
    return aiControl;
  }

  toControlObject() {
    const controlObj = {};
    AI_CONTROL_SETTINGS.forEach((setting) => controlObj[setting] = this[setting]);
    return controlObj;
  }
}

class AiMeta {
  name;
  description;
  author;
  link;
  version;
  defaultLang;
  supportedLang;
  switched;
  nativeRoot;
  root;

  portraitAssetPath;

  #dataRow;
  #dataRowImg;

  static META_FILE = "meta.json";

  #appendDataRowImg() {
    const newCell = document.createElement("td");
    this.#dataRowImg = document.createElement("img");
    this.#dataRowImg.classList.add("ai-image", "selectable");
    this.#dataRowImg.src = AI_PORTRAIT_MISSING;
    this.#dataRowImg.tabIndex = 0;
    newCell.appendChild(this.#dataRowImg);
    this.#dataRow.appendChild(newCell);

    // event
    addEnterAndClickListener(this.#dataRowImg, () => document.dispatchEvent(new CustomEvent(AI_SELECT_EVENT, {
      detail: {
        meta: this,
      },
    })));
  }

  #createDataRow() {
    this.#dataRow = document.createElement("tr");
    this.#dataRow.classList.add("ai-meta-row");

    this.#appendDataRowImg();

    this.#dataRow.appendChild(createTextCell(this.name));
    this.#dataRow.appendChild(createTextCell(this.version));
    this.#dataRow.appendChild(createTextCell(this.author));
    this.#dataRow.appendChild(createTextCell(this.nativeRoot));
    this.#dataRow.appendChild(createTextCell(this.defaultLang));
    this.#dataRow.appendChild(createTextCell(this.supportedLang.join(', ')));

    AI_CONTROL_SETTINGS.forEach((setting) => this.#dataRow.appendChild(createBooleanCell(this.switched[setting])));
  }

  constructor(nativeMetaPath, metaObj) {
    this.name = receiveStringOrFallback(metaObj.name, DEFAULT_VALUE_MARKER);
    this.description = receiveStringOrFallback(metaObj.description, DEFAULT_VALUE_MARKER);
    this.author = receiveStringOrFallback(metaObj.author, DEFAULT_VALUE_MARKER);
    this.link = receiveStringOrFallback(metaObj.link, DEFAULT_VALUE_MARKER);
    this.version = receiveStringOrFallback(metaObj.version, DEFAULT_VALUE_MARKER);
    this.defaultLang = receiveStringOrFallback(metaObj.defaultLang);
    this.supportedLang = Array.isArray(metaObj.supportedLang) ? metaObj.supportedLang : [];
    this.switched = AiControl.fromControlObject(metaObj.switched ?? {}, false);
    this.nativeRoot = nativeMetaPath.replace(AiMeta.META_FILE, DEFAULT_VALUE_MARKER);
    this.root = createVersionFreeRootPath(this.nativeRoot)

    this.#createDataRow();
  }

  async loadAssetPortrait() {
    if (this.switched.portrait) {
      this.portraitAssetPath = await HOST_FUNCTIONS.getAssetUrl(`${this.nativeRoot}/portrait.png`);
      this.#dataRowImg.src = this.portraitAssetPath;
    }
  }

  appendRowToParent(parent) {
    parent.appendChild(this.#dataRow);
  }

  static async fromNativeMetaRootPath(nativeMetaRootPath) {
    return this.fromNativeMetaPath(`${nativeMetaRootPath}/${AiMeta.META_FILE}`);
  }

  static async fromNativeMetaPath(nativeMetaPath) {
    const loadedFile = await (HOST_FUNCTIONS.getTextFile(nativeMetaPath).catch(() => null));
    if (!loadedFile) {
      return null;
    }
    const metaObj = JSON.parse(loadedFile);

    const aiMeta = new AiMeta(nativeMetaPath, metaObj);
    await aiMeta.loadAssetPortrait();

    return aiMeta;
  }
}

class AiSetting {
  name;
  language;
  root;
  control;
  aiMeta;
  extension;

  #dataRow;
  #controlCell;
  #boolCells = {};

  #appendDataRowControl() {
    this.#controlCell = document.createElement("td");

    const controlDiv = this.#controlCell.appendChild(document.createElement("div"));
    controlDiv.classList.add("ai-setting-control");

    const prioDiv = controlDiv.appendChild(document.createElement("div"));

    const prioUpDiv = prioDiv.appendChild(document.createElement("div"));
    prioUpDiv.textContent = "\u2B99";
    prioUpDiv.classList.add("priority", "up");
    prioUpDiv.tabIndex = 0;
    addEnterAndClickListener(prioUpDiv, () => document.dispatchEvent(new CustomEvent(AI_CHANGE_UPDATE_EVENT, {
      detail: {
        type: "priority",
        aiSetting: this,
        priority: -1,
      }
    })));

    const prioDownDiv = prioDiv.appendChild(document.createElement("div"));
    prioDownDiv.textContent = "\u2B9B";
    prioDownDiv.classList.add("priority", "down");
    prioDownDiv.tabIndex = 0;
    addEnterAndClickListener(prioDownDiv, () => document.dispatchEvent(new CustomEvent(AI_CHANGE_UPDATE_EVENT, {
      detail: {
        type: "priority",
        aiSetting: this,
        priority: +1,
      }
    })));

    const removeDiv = controlDiv.appendChild(document.createElement("div"));
    removeDiv.textContent = "\u2716";
    removeDiv.classList.add("remove");
    removeDiv.tabIndex = 0;
    addEnterAndClickListener(removeDiv, () => document.dispatchEvent(new CustomEvent(AI_CHANGE_UPDATE_EVENT, {
      detail: {
        type: "remove",
        aiSetting: this,
      }
    })));

    this.#dataRow.appendChild(this.#controlCell);
  }

  #appendDataRowImg() {
    const newCell = document.createElement("td");
    const img = document.createElement("img");
    img.classList.add("ai-image");
    img.src = this.aiMeta.portraitAssetPath ?? AI_PORTRAIT_MISSING;
    newCell.appendChild(img);
    this.#dataRow.appendChild(newCell);
  }

  #appendDataRowLanguage() {
    const newCell = document.createElement("td")
    const newSelect = document.createElement("select");

    newSelect.appendChild(createSimpleOptionElement(DEFAULT_VALUE_MARKER, GENERAL_LOCALIZATION["change.language.default"]));
    newSelect.appendChild(createSimpleOptionElement("default", GENERAL_LOCALIZATION["change.language.default.ai"]));
    this.aiMeta.supportedLang.forEach((lang) => newSelect.appendChild(createSimpleOptionElement(lang)));

    if (!this.language) {
      newSelect.value = DEFAULT_VALUE_MARKER;
    } else if (this.language === this.aiMeta.defaultLang) {
      newSelect.value = "default";
    } else {
      newSelect.value = this.language;
    }

    newSelect.onchange = () => {
      const newValue = newSelect.value;
      if (newValue === DEFAULT_VALUE_MARKER) {
        this.language = undefined;
      } else if (newValue === "default") {
        this.language = this.aiMeta.defaultLang;
      } else {
        this.language = newValue;
      }
    }

    newCell.appendChild(newSelect);
    this.#dataRow.appendChild(newCell);
  }

  #setDataRowBooleanClass(element, statusBool) {
    if (!isPrimitiveBool(statusBool)) {
      element.classList.add("ignored");
      element.classList.remove("active", "inactive");
    } else if (statusBool) {
      element.classList.add("active");
      element.classList.remove("ignored", "inactive");
    } else {
      element.classList.add("inactive");
      element.classList.remove("ignored", "active");
    }
  }

  #appendDataRowBoolean(setting) {
    const newCell = createBooleanCell(this.control[setting]);
    newCell.classList.add("ai-setting-bool");
    newCell.tabIndex = 0; // does not really work, since the redraw of the table removes focus

    const metaSettingExists = this.aiMeta.switched[setting];
    if (!metaSettingExists) {
      newCell.classList.add("no-setting");
    }
    addEnterAndClickListener(newCell, () => {
      const currentValue = this.control[setting];
      const newValue = !isPrimitiveBool(currentValue) ? metaSettingExists : (currentValue ? false : undefined);
      this.control[setting] = newValue;
      this.#setDataRowBooleanClass(newCell, newValue);
      newCell.textContent = createBooleanText(newValue);

      // will be pretty heavy
      document.dispatchEvent(new CustomEvent(AI_CHANGE_UPDATE_EVENT));
    });

    this.#setDataRowBooleanClass(newCell, this.control[setting]);
    this.#dataRow.appendChild(newCell);
    this.#boolCells[setting] = newCell;
  }

  #createDataRow() {
    this.#dataRow = document.createElement("tr");
    this.#dataRow.classList.add("ai-setting-row");

    if (!this.extension) {
      this.#dataRow.classList.add("ai-setting-row--user");
    }

    this.#appendDataRowControl();
    this.#dataRow.appendChild(createTextCell(this.extension ?? "-"));
    this.#appendDataRowImg();
    this.#dataRow.appendChild(createTextCell(this.name));
    this.#dataRow.appendChild(createTextCell(this.root));

    this.#appendDataRowLanguage();

    AI_CONTROL_SETTINGS.forEach((setting) => this.#appendDataRowBoolean(setting));
  }

  #verifyAiControlSetting(currentSetting, metaSetting) {
    // unsets if control stops being available
    return currentSetting && !metaSetting ? undefined : currentSetting;
  }

  #verifyAiControl() {
    const aiMetaSwitched = this.aiMeta.switched;
    const aiControl = this.control;

    AI_CONTROL_SETTINGS.forEach((setting) => aiControl[setting] = this.#verifyAiControlSetting(aiControl[setting], aiMetaSwitched[setting]));
  }

  #setInteractionStatus(active) {
    this.#dataRow.querySelectorAll(active ? '[tabIndex="-1"]' : '[tabIndex="0"]').forEach((elem) => elem.tabIndex = active ? 0 : -1);
    this.#dataRow.querySelectorAll(active ? 'select[disabled]' : 'select').forEach((elem) => elem.disabled = !active);

    const controls = this.#controlCell.querySelector(".ai-setting-control");
    active ? controls.removeAttribute("inert") : controls.setAttribute("inert", "");
  }

  constructor(meta, settingObj) {
    this.aiMeta = meta;

    this.extension = settingObj.extension;
    this.name = receiveStringOrFallback(this.aiMeta.name, DEFAULT_VALUE_MARKER);
    this.root = receiveStringOrFallback(this.aiMeta.root, DEFAULT_VALUE_MARKER);
    this.language = receiveStringOrFallback(settingObj.language);
    this.control = AiControl.fromControlObject(settingObj.control ?? {});
    this.#verifyAiControl();

    // updating state based on meta, in case invalid settings are present
    if (this.name !== this.aiMeta.name) {
      this.name = this.aiMeta.name;
    }

    if ((this.language && !this.aiMeta.supportedLang.includes(this.language)) || this.language === DEFAULT_VALUE_MARKER) {
      this.language = undefined;
    }

    this.#createDataRow();
    this.#setInteractionStatus(!this.extension);
  }

  setBoolCellCurrent(controlName, isCurrent) {
    this.#boolCells[controlName].classList.toggle("current", isCurrent);
  }

  appendRowToParent(parent) {
    parent.appendChild(this.#dataRow);
  }

  toSettingNameAndObject() {
    const settingObj = {
      name: this.name,
      language: this.language,
      root: this.root,
      control: this.control.toControlObject(),
    };
    return settingObj;
  }

  // if received from a present config
  static fromMetaAndSettings(meta, settingObj) {
    if (meta.root !== receiveStringOrFallback(settingObj.root, DEFAULT_VALUE_MARKER)) {
      return null; // something went wrong, just ignore it for now
    }
    return new AiSetting(meta, settingObj);
  }

  // sets everything present to true by default, others is undefined
  static fromMeta(meta) {
    const settingsObj = {
      control: {},
    };
    AI_CONTROL_SETTINGS.forEach((setting) => settingsObj.control[setting] = meta.switched[setting] ? true : undefined);
    return new AiSetting(meta, settingsObj);
  }
}

class AiSelectMenu {
  #mainElem;
  #selectTable;
  #filterInput;
  #regexCheckbox;

  #sortAndCreateSelectTable() {
    const filter = this.#filterInput.value;
    this.#selectTable.replaceChildren();
    if (!filter) {
      FOUND_AI_META.forEach((meta) => meta.appendRowToParent(this.#selectTable));
      return;
    }

    if (this.#regexCheckbox?.checked) {
      const filterRegex = new RegExp(filter);
      FOUND_AI_META.forEach((meta) => !filterRegex.test(meta.name) || meta.appendRowToParent(this.#selectTable));
    } else {
      FOUND_AI_META.forEach((meta) => !meta.name.includes(filter) || meta.appendRowToParent(this.#selectTable));
    }
  }

  constructor(mainElem) {
    this.#mainElem = mainElem;
    this.#selectTable = document.querySelector(".ai-swapper__select-menu__table__body");

    const closeButton = this.#mainElem.querySelector(".ai-swapper__select-menu__close");
    addEnterAndClickListener(closeButton, () => this.#mainElem.close());

    this.#filterInput = this.#mainElem.querySelector(".ai-filter-input");
    this.#regexCheckbox = this.#mainElem.querySelector(".ai-filter-regex");

    const filterChangeEvent = () => this.#sortAndCreateSelectTable();
    this.#filterInput.onchange = filterChangeEvent;
    this.#regexCheckbox.onchange = filterChangeEvent;

    this.#sortAndCreateSelectTable();

    document.addEventListener(AI_SELECT_EVENT, () => closeButton.click());
  }
}

class AiChangeMenu {
  #mainElem;
  #currentSlotName = null;
  #currentSlot = null;

  #tableBodyElement;
  #slotNameElem;
  #selectAiElem;
  #selectMainText;

  #updateTable() {
    this.#tableBodyElement.replaceChildren();
    this.#currentSlot.updatePluginAndAiSettingsCellStatus();
    this.#currentSlot.appendAllPluginAndAiSettings(this.#tableBodyElement);
  }

  #changeEvent(detail) {
    switch (detail.type) {
      case "remove": {
        this.#currentSlot.removeAiSetting(detail.aiSetting);
        break;
      }
      case "priority": {
        this.#currentSlot.changePriority(detail.aiSetting, detail.priority);
        break;
      }
    }
    this.#updateTable();
  }

  constructor(mainElem, selectMenu) {
    this.#mainElem = mainElem;

    this.#tableBodyElement = this.#mainElem.querySelector(".ai-swapper__change-menu__table__body");
    this.#slotNameElem = this.#mainElem.querySelector(".slot-name");
    this.#selectAiElem = this.#mainElem.querySelector(".ai-swapper__change-menu__select");
    this.#selectMainText = this.#selectAiElem.textContent;

    addEnterAndClickListener(this.#mainElem.querySelector(".ai-swapper__change-menu__close"), () => {
      this.#currentSlot.updateStatus();
      this.#mainElem.close();
    });
    addEnterAndClickListener(this.#selectAiElem, () => selectMenu.showModal());

    document.addEventListener(AI_SELECT_EVENT, (event) => {
      this.#currentSlot.receiveNewAiSetting(event.detail.meta).appendRowToParent(this.#tableBodyElement);
      document.dispatchEvent(new CustomEvent(AI_CHANGE_UPDATE_EVENT));
    });

    document.addEventListener(AI_CHANGE_UPDATE_EVENT, (event) => this.#changeEvent(event.detail ?? {}));
  }

  activateEditDialog(aiSlot, slotName, localizedSlotName) {
    this.#currentSlotName = slotName;
    this.#slotNameElem.textContent = localizedSlotName ?? this.#currentSlotName;
    this.#currentSlot = aiSlot;

    this.#selectAiElem.textContent = this.#selectMainText;

    this.#updateTable();
    this.#mainElem.showModal();
  }
}

class AiSlot {
  #slotName;
  #aiSettings = [];
  #pluginSettings = [];

  #localizedSlotName;
  #changeMenu;
  #mainElem;
  #imgElem;
  #aiNameElem;

  constructor(slotName) {
    this.#slotName = slotName;
  }

  pushBaselineSetting(aiSetting) {
    this.#pluginSettings.push(aiSetting);
  }

  pushUserSetting(aiSetting) {
    this.#aiSettings.push(aiSetting);
  }

  appendUserMenuEntryForSlot(menu) {
    if (!this.#aiSettings.length) {
      menu[this.#slotName] = undefined; // deleting old setting
      return;
    }
    menu[this.#slotName] = this.#aiSettings.map((setting) => setting.toSettingNameAndObject());
  }

  appendAiControlSettingsForSlot(config) {
    AI_CONTROL_SETTINGS.forEach((controlSetting) => {
      const configKey = `ai.${this.#slotName}.${controlSetting}`;

      for (const aiSetting of this.#aiSettings) {
        if (!isPrimitiveBool(aiSetting.control[controlSetting])) {
          continue;
        }

        config[configKey] = {
          name: aiSetting.name,
          root: aiSetting.root,
          active: aiSetting.control[controlSetting],
          language: aiSetting.language,
        }
        return;
      }

      config[configKey] = undefined; // unset
    });
  }

  getAiSlotName() {
    if (!this.#aiSettings.length && !this.#pluginSettings.length) {
      return this.#localizedSlotName;
    }
    // using first that has any kind of setting
    for (const aiSetting of this.#aiSettings) {
      if (AI_CONTROL_SETTINGS.map((setting) => aiSetting.control[setting]).some(isPrimitiveBool)) {
        return aiSetting.name;
      }
    }
    for (const aiSetting of this.#pluginSettings) {
      if (AI_CONTROL_SETTINGS.map((setting) => aiSetting.control[setting]).some(isPrimitiveBool)) {
        return aiSetting.name;
      }
    }
    return this.#localizedSlotName;
  }

  getAiImgSource() {
    for (const aiSetting of this.#aiSettings) {
      const controlValue = aiSetting.control.portrait;
      if (!isPrimitiveBool(controlValue)) {
        continue;
      }
      if (!controlValue) {
        return AI_PORTRAIT_DATA[this.#slotName];
      }
      return aiSetting.aiMeta.portraitAssetPath ?? AI_PORTRAIT_MISSING;
    }
    for (const aiSetting of this.#pluginSettings) {
      const controlValue = aiSetting.control.portrait;
      if (!isPrimitiveBool(controlValue)) {
        continue;
      }
      if (!controlValue) {
        return AI_PORTRAIT_DATA[this.#slotName];
      }
      return aiSetting.aiMeta.portraitAssetPath ?? AI_PORTRAIT_MISSING;
    }
    return AI_PORTRAIT_DATA[this.#slotName];
  }

  receiveNewAiSetting(aiMeta) {
    const newAiSetting = AiSetting.fromMeta(aiMeta);
    this.#aiSettings.push(newAiSetting);
    return newAiSetting;
  }



  #activateEditDialog() {
    this.#changeMenu.activateEditDialog(this, this.#slotName, this.#localizedSlotName);
  }

  async loadLocalizedSlotName() {
    this.#localizedSlotName = await HOST_FUNCTIONS.getLocalizedString(`slot.name.${this.#slotName}`) ?? this.#slotName.toUpperCase();
  }

  initializeElement(template, changeMenu) {
    this.#changeMenu = changeMenu;

    this.#mainElem = template.content.cloneNode(true);
    this.#imgElem = this.#mainElem.querySelector(".ai-image");
    this.#aiNameElem = this.#mainElem.querySelector(".ai-name");

    const slotNameElem = this.#mainElem.querySelector(".slot-name");
    if (!!slotNameElem && !!this.#slotName) {
      slotNameElem.textContent = this.#localizedSlotName;
    }
    this.#mainElem.querySelector(".ai-swapper__overview__ai")?.classList.add(`slot--${this.#slotName}`);

    addEnterAndClickListener(this.#imgElem, () => this.#activateEditDialog());
  }

  appendAsChildTo(parent) {
    parent?.appendChild(this.#mainElem);
  }

  appendAllPluginAndAiSettings(parent) {
    this.#aiSettings.forEach((setting) => setting.appendRowToParent(parent));
    this.#pluginSettings.forEach((setting) => setting.appendRowToParent(parent));
  }

  updateStatus() {
    this.#imgElem.src = this.getAiImgSource();
    this.#aiNameElem.textContent = this.getAiSlotName();
  }

  updatePluginAndAiSettingsCellStatus() {
    AI_CONTROL_SETTINGS.forEach((controlSetting) => {
      let discoveredActive = false;

      this.#aiSettings.forEach((aiSetting) => {
        if (discoveredActive) {
          aiSetting.setBoolCellCurrent(controlSetting, false);
          return;
        }
        discoveredActive = isPrimitiveBool(aiSetting.control[controlSetting]);
        aiSetting.setBoolCellCurrent(controlSetting, discoveredActive);
      });

      this.#pluginSettings.forEach((pluginSetting) => {
        if (discoveredActive) {
          pluginSetting.setBoolCellCurrent(controlSetting, false);
          return;
        }
        discoveredActive = isPrimitiveBool(pluginSetting.control[controlSetting]);
        pluginSetting.setBoolCellCurrent(controlSetting, discoveredActive);
      });
    });
  }

  removeAiSetting(aiSetting) {
    const index = this.#aiSettings.indexOf(aiSetting);
    if (index < 0) {
      return; // nothing found
    }
    this.#aiSettings.splice(index, 1);
  }

  changePriority(aiSetting, priorityChange) {
    const index = this.#aiSettings.indexOf(aiSetting);
    if (index < 0) {
      return; // nothing found
    }
    this.#aiSettings.splice(index + priorityChange, 0, ...this.#aiSettings.splice(index, 1));
  }
}


/** RESULT FUNCTIONS **/

function createResultConfig() {
  const configState = {};

  configState.menu = {};
  AI_SLOTS.forEach((slot) => slot.appendUserMenuEntryForSlot(configState.menu));
  configState.defaultLanguage = DEFAULT_LANGUAGE ? DEFAULT_LANGUAGE : null;

  AI_SLOTS.forEach((slot) => slot.appendAiControlSettingsForSlot(configState));
  return configState;
}


/** INIT FUNCTIONS **/

async function initData() {
  AI_SLOTS_NAMES.forEach((slotName) => AI_SLOTS.set(slotName, new AiSlot(slotName)));
  for (const [, slot] of AI_SLOTS) {
    await slot.loadLocalizedSlotName();
  }

  for (const key of Object.keys(GENERAL_LOCALIZATION)) {
    GENERAL_LOCALIZATION[key] = await HOST_FUNCTIONS.getLocalizedString(key) ?? key;
  }
}

async function receiveAllAvailableAi() {
  const foundAis = await HOST_FUNCTIONS.receivePluginPaths("resources/ai", `**/${AiMeta.META_FILE}`);
  for (const foundAi of foundAis) {
    (await Promise.all(foundAi.paths.map(AiMeta.fromNativeMetaPath)))
      .filter((meta) => !!meta)
      .toSorted((metaOne, metaTwo) => metaOne.name.localeCompare(metaTwo.name) || metaOne.root.localeCompare(metaTwo.root))
      .forEach((meta) => FOUND_AI_META.set(meta.root, meta));
  }
}

async function receiveCurrentConfig() {
  const { baseline, user } = await HOST_FUNCTIONS.getCurrentConfig();

  // ignore baseline default language and menu
  const { defaultLanguage: _baselineDefaultLanguage, menu: _baselineMenu, ...baselineAi } = baseline;
  const { defaultLanguage, menu } = user;

  if (defaultLanguage) {
    DEFAULT_LANGUAGE = defaultLanguage;
  }

  const baselineConfigObject = Object.entries(baselineAi)
    .map(([key, value]) => [
      key.replace("ai.", ""),
      value.modifications.value.entity,
      value.modifications.value.content,
    ])
    .reduce(
      (resultObj, [aiSettingUrl, extension, value]) => {
        const [ai, aiSetting] = aiSettingUrl.split(".");
        const aiObj = resultObj[ai] = resultObj[ai] ?? {};

        // clean version if present
        value.root = createVersionFreeRootPath(value.root);

        const sourceKey = `${extension}-${value.root}-${value.name}-${value.language}`;
        if (!aiObj[sourceKey]) {
          const configObj = aiObj[sourceKey] = {};
          configObj.root = value.root;
          configObj.name = value.name;
          configObj.control = {};
          configObj.language = value.language;
          configObj.extension = extension;
        }
        aiObj[sourceKey].control[aiSetting] = value.active;
        return resultObj;
      },
      {}
    );
  for (const [ai, configObj] of Object.entries(baselineConfigObject)) {
    Object.values(configObj).filter((config) => FOUND_AI_META.has(config.root))
      .map((config) => AiSetting.fromMetaAndSettings(FOUND_AI_META.get(config.root), config))
      .filter((aiSetting) => !!aiSetting)
      .forEach((aiSetting) => AI_SLOTS.get(ai)?.pushBaselineSetting(aiSetting));
  }

  // filter to handle keys set to undefined
  for (const [ai, configArray] of Object.entries(menu ?? {}).filter(([, configArray]) => !!configArray)) {
    configArray.map((config) => {
       // clean version if present
      config.root = createVersionFreeRootPath(config.root);
      return config;
    })
      .filter((config) => FOUND_AI_META.has(config.root))
      .map((config) => AiSetting.fromMetaAndSettings(FOUND_AI_META.get(config.root), config))
      .filter((aiSetting) => !!aiSetting)
      .forEach((aiSetting) => AI_SLOTS.get(ai)?.pushUserSetting(aiSetting));
  }
}

function initMainElements() {
  const changeMenuElem = document.querySelector(".ai-swapper__change-menu");
  const selectMenuElem = document.querySelector(".ai-swapper__select-menu");
  const changeMenu = new AiChangeMenu(changeMenuElem, selectMenuElem);
  new AiSelectMenu(selectMenuElem); // bad form -> currently only created for side effects

  const overviewElem = document.querySelector(".ai-swapper__overview");
  const overviewTemp = document.querySelector(".template--ai-overview-slot");
  for (const slot of AI_SLOTS.values()) {
    slot.initializeElement(overviewTemp, changeMenu);
    slot.updateStatus();
    slot.appendAsChildTo(overviewElem);
  }

  const defaultLanguageSelect = document.querySelector(".ai-swapper__default-language__select");
  // collect and order all languages
  const allLangs = new Set();
  FOUND_AI_META.forEach((meta) => {
    meta.supportedLang.forEach((lang) => allLangs.add(lang));
  });
  if (!allLangs.has(DEFAULT_LANGUAGE)) {
    DEFAULT_LANGUAGE = DEFAULT_VALUE_MARKER; // remove if not present
  }
  [...allLangs].sort().forEach((lang) => defaultLanguageSelect.appendChild(createSimpleOptionElement(lang)));
  defaultLanguageSelect.value = DEFAULT_LANGUAGE;
  defaultLanguageSelect.onchange = () => DEFAULT_LANGUAGE = defaultLanguageSelect.value;

  document.querySelector(".ai-swapper").hidden = false;
}


/** INIT **/

addEventListener(
  DONE_EVENT_NAME,
  async () => {
    await initData();
    await receiveAllAvailableAi();
    await receiveCurrentConfig();
    initMainElements();
    SANDBOX_FUNCTIONS.getConfig = createResultConfig;
  },
  { once: true }
);

